import React from 'react'

function Cart(props) {
  console.log("hey ");
  console.log(props.cartItems);
  // if (!props.cartItems) {
  //   return <div>No items in the cart</div>;
  // }
  return (
    <div className='cart'>
      <h2>Cart</h2>
      {props.cartItems.map((index, item)=>(
        <div key={index}>
        <h1>{item.name}</h1>
        </div>
      ))}
    </div>
  )
}

export default Cart
